import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";

function Expenses(props){

    const {title1, amount1, date1} = props.items[0];
    
    return (
    <div className="expenses">
     
     <ExpenseItem   
        title={title1}
        amount={amount1}
        date={date1}
        />
     

        
    </div>
    );
}

export default Expenses;
